import './login.css'
import {useRef} from "react"
function Login() {

    const handleClick=(e)=>{
        const Email=useRef();
        const Pwd=useRef();
        e.preventDefault();

    }

    return (
        <div className="login">
            <div className="loginWrapper">
                <div className="loginLeft">
                    <h3 className="loginLogo">Utopia</h3>
                    <span className="loginDesc">Reach out to the world with Utopia.</span>
                </div>
                <div className="loginRight">
                    <form className="loginBox" onSubmit={handleClick}>
                        <input placeholder="Email" type="email" className="loginInput" ref={Email}/>
                        <input placeholder="Password" type="password" className="loginInput" ref={Pwd}/>
                        <button className="loginButton">Log In</button>
                        <span className="forgotPwd">Forgot Password?</span>
                        <button className="loginregisterButton">Create a New Account</button>
                    </form>
                </div>
            </div>
        </div>    
    )
}

export default Login
